import React from "react";
import Chat from "../components/Chat";
import Sidebar from "../components/Sidebar";

function Home() {
  return (
    <div className="home">
      <div class="container">
        <Sidebar />
        <Chat />
      </div>
    </div>
  );
}

export default Home;
